import logo from './img/logo.svg';

function Header(){
  return <header><img src={logo} alt='logo'/></header>;
}

function Footer(){
  return (<footer>
    <p>powered by React</p>
    <p>made by Kyrylo Zarytskyi</p>
  </footer>);
}

function MainPage(){
  return (
      <body>
        <Header/>
        <Footer/>
      </body>
    );
}

export default MainPage;
